import React from 'react';
import CatalogItem from '../Catalog/CatalogoItem';

const CatalogList = ({ items }) => {
  return (
    <div>
      {items.map(item => (
        <CatalogItem key={item.id} item={item} />
      ))}
    </div>
  );
};

export default CatalogList;
